import React, { Component } from "react";
import FeaturedItem from "./FeaturedItem";

export class FeaturedList extends Component {
  render() {

    let {courses} = this.props
    return (
      <div className="featured__list">
        <FeaturedItem />
        {courses.map((item,index))}


      </div>
    );
  }
}
